.eqv BASE_ADDRESS 0x10008000
.eqv END_ADDRESS 0x10008ffc
.eqv END_PIXEL 16384
.eqv WIDTH 4 # Width of an integer
.eqv PERROW 64
.eqv SLEEP 40

.text
li $t0, BASE_ADDRESS	# stores the base address for display
li $s0, 0x000000	# stores the black colour code
li $s1, 0		# Binary Check for coins
li $s2, 0x71b415	# stores the green colour code
li $s3, 0x4a72e9	# stores the blue colour code
li $s4, 0xffd028	# stores the yellow colour code
li $s5, 0xffffff	# stores colour code for colour arrays (white by default)
li $s6, 1		# Binary Check 
li $s7, 1		# Which level player is in

li $t1, 0		# Counter
li $t2, 0		# Keypress
li $t3, 0		# current position address
move $t4, $t0		# temporary register for base address
li $t5, 15		# starting X position
li $t6, 47		# starting Y position
la $t7, wincolour	# Register for temporary array of colours

main:
	li $t9, 0xffff0000 # hex code for keyboard

	menu:
		# Display Main Menu on BitMap Display
		bgt $s7, 3, youwin
		lw $s5, 0($t7)
		sw $s5, 0($t4)
		addi $t7, $t7, 4
		addi $t4, $t4, WIDTH
		addi $t1, $t1, WIDTH
		blt $t1, END_PIXEL, menu
		j continue
	
	continue:
		lw $t8, 0($t9)
		beq $t8, 1, keypress_happened

	keypress_happened:
		# Sleep Time
		li $v0, 32
		li $a0, SLEEP # Wait
		syscall
		# Reset Base Address and Counter
		move $t4, $t0
		li $t1, 0
		#Keyboard Operatrions
		lw $t2, 4($t9) 			# this assumes $t9 is set to 0xfff0000 from before
		beq $t2, 0x65, END 		# Hex code of 'e' is 0x65, set to exit and call $v0 10
		beq $t2, 0x71, quit 		# Hex code of 'q' is 0x71, set to quit
		beq $t2, 0x72, restart 		# Hex code of 'r' is 0x72, set to restart
		beq $t2, 0x73, restart 		# Hex code of 's' is 0x73, set to restart
		beq $t2, 0x61, move_left 	# Hex code of 'a' is 0x61, set to move left
		beq $t2, 0x64, move_right 	# Hex code of 's' is 0x64, set to move right
		beq $t2, 0x77, jump 		# Hex code of 'w' is 0x77, set to jump
		j keypress_happened
	
	restart:
		jal game
		j keypress_happened
	
	quit:
		# Quit to Main Menu
		# Display Main Menu on BitMap Display
		la $t7, menucolour # set $t7 to address of menucolour
		quitloop:
			lw $s5, 0($t7)
			sw $s5, 0($t4)
			addi $t7, $t7, 4
			addi $t4, $t4, WIDTH
			addi $t1, $t1, WIDTH
			blt $t1, END_PIXEL, quitloop
		j keypress_happened
			
	gameover:
		# Game Over Screen
		la $t7, gameovercolour # set $t7 to address of menucolour
		overloop:
			lw $s5, 0($t7)
			sw $s5, 0($t4)
			addi $t7, $t7, 4
			addi $t4, $t4, WIDTH
			addi $t1, $t1, WIDTH
			blt $t1, END_PIXEL, overloop
		j keypress_happened
		
	youwin:
		# Win Screen
		la $t7, wincolour # set $t7 to address of menucolour
		winloop:
			lw $s5, 0($t7)
			sw $s5, 0($t4)
			addi $t7, $t7, 4
			addi $t4, $t4, WIDTH
			addi $t1, $t1, WIDTH
			blt $t1, END_PIXEL, winloop
		j keypress_happened

game:
	
	startpos:
		beq $s7, 1, ONE
		beq $s7, 2, TWO
		beq $s7, 3, THREE
		
		ONE:
			# Different Starts for different levels
			li $t5, 15
			li $t6, 47
			j calcpos
		TWO:
			# Different Starts for different levels
			li $t5, 15
			li $t6, 51
			j calcpos
		THREE:
			# Different Starts for different levels
			li $t5, 32
			li $t6, 50
			j calcpos
	
	calcpos:
		bltz $t5, resetleft
		bltz $t6, restart
		bgt $t5, 61, resetright
		bgt $t6, PERROW, gameover
		# adress(x,y) = address(t5,t6) = (t6 * PERROW + t5)*4
		li $t8, PERROW
		mult $t8, $t6
		mflo $t3
		add $t3, $t3, $t5
		li $t8, WIDTH
		mult $t3, $t8
		mflo $t3
	
	
	# Display Level 1 Stage on BitMap Display
	stage:
		bgt $s7, 3, youwin
		beq $s7, 1, BGONE
		beq $s7, 2, BGTWO
		beq $s7, 3, BGTHREE
		
		BGONE:
			la $t7, level1
			j stageloop
		BGTWO:
			la $t7, level2
			j stageloop
		BGTHREE:
			la $t7, level3
			j stageloop
		
		stageloop:
			lw $s5, 0($t7)
			sw $s5, 0($t4)
			addi $t7, $t7, 4
			addi $t4, $t4, WIDTH
			addi $t1, $t1, WIDTH
			blt $t1, END_PIXEL, stageloop
	
	coin:	
		beq $s7, 1, COINONE
		beq $s7, 2, COINTWO
		beq $s7, 3, COINTHREE
		
		COINONE:
			move $t4, $t0
			add $t4, $t4, 5000
			j coinpos
			
		COINTWO:
			move $t4, $t0
			add $t4, $t4, 5920
			j coinpos
		
		COINTHREE:
			move $t4, $t0
			add $t4, $t4, 6300
			j coinpos
			
		coinpos:
			sw $s4, 0($t4)
			addi $t4, $t4, 4
			sw $s4, 0($t4)
			addi $t4, $t4, 4
			sw $s4, 0($t4)
			addi $t4, $t4, 4
			addi $t4, $t4, 244
			sw $s4, 0($t4)
			addi $t4, $t4, 4
			sw $s4, 0($t4)
			addi $t4, $t4, 4
			sw $s4, 0($t4)
			addi $t4, $t4, 4
			addi $t4, $t4, 244
			sw $s4, 0($t4)
			addi $t4, $t4, 4
			sw $s4, 0($t4)
			addi $t4, $t4, 4
			sw $s4, 0($t4)
			addi $t4, $t4, 4
	
	moving:	
		beq $s7, 1, MOVEONE
		beq $s7, 2, MOVETWO
		beq $s7, 3, MOVETHREE
		
		MOVEONE:
			move $t4, $t0
			add $t4, $t4, 9424
			j movepos
			
		MOVETWO:
			move $t4, $t0
			add $t4, $t4, 9200
			j movepos
		
		MOVETHREE:
			move $t4, $t0
			add $t4, $t4, 10000
			j movepos
			
		movepos:
			sw $s2, 0($t4)
			addi $t4, $t4, 4
			sw $s2, 0($t4)
			addi $t4, $t4, 4
			sw $s2, 0($t4)
			addi $t4, $t4, 4
			addi $t4, $t4, 244
			sw $s2, 0($t4)
			addi $t4, $t4, 4
			sw $s2, 0($t4)
			addi $t4, $t4, 4
			sw $s2, 0($t4)
			addi $t4, $t4, 4
			addi $t4, $t4, 244
			sw $s2, 0($t4)
			addi $t4, $t4, 4
			sw $s2, 0($t4)
			addi $t4, $t4, 4
			sw $s2, 0($t4)
			addi $t4, $t4, 4
			j character
	
	character:
		move $t4, $t0
		add $t4, $t4, $t3
		li $s6, 1
		
		# Check if pixel is coin
		lw $s0, 0($t4)
		beq $s0, $s4, touchcoin
		li $s0, 0x000000
		
		sw $s0, 0($t4)
		addi $t4, $t4, 4
		
		# Check if pixel is coin
		lw $s0, 0($t4)
		beq $s0, $s4, touchcoin
		li $s0, 0x000000
		
		sw $s0, 0($t4)
		addi $t4, $t4, 4
		
		# Check if pixel is coin
		lw $s0, 0($t4)
		beq $s0, $s4, touchcoin
		li $s0, 0xdb0c29
		
		sw $s0, 0($t4)
		addi $t4, $t4, 256
		
		# Check if pixel is coin
		lw $s0, 0($t4)
		beq $s0, $s4, touchcoin
		li $s0, 0x000000
		
		sw $s0, 0($t4)
		subi $t4, $t4, 4
		
		# Check if pixel is coin
		lw $s0, 0($t4)
		beq $s0, $s4, touchcoin
		li $s0, 0x000000
		
		sw $s0, 0($t4)
		subi $t4, $t4, 4
		
		# Check if pixel is coin
		lw $s0, 0($t4)
		beq $s0, $s4, touchcoin
		li $s0, 0x000000
		
		sw $s0, 0($t4)
		addi $t4, $t4, 260
		
		# Check if pixel is coin
		lw $s0, 0($t4)
		beq $s0, $s4, touchcoin
		li $s0, 0x000000
		
		sw $s0, 0($t4)

		j continue
		
	touchcoin:
		addi $s7, $s7, 1
		j startpos
	 
	move_left:
		subi $t5, $t5, 1
    		j calcpos
	
	move_right:
		addi $t5, $t5, 1
    		j calcpos
    	
    	jump:	
		subi $t6, $t6, 1
		j calcpos
    		
    	move_down:
		addi $t6, $t6, 1
    		j calcpos
    		
    	resetleft:
    		li $t5, 0
    		j calcpos
    	
    	resetright:
    		li $t5, 61
    		j calcpos

END:
	# Display Black Screen on BitMap Display
	li $s0, 0x000000
	sw $s0, 0($t4)
	addi $t4, $t4, WIDTH
	addi $t1, $t1, WIDTH
	blt $t1, END_PIXEL, END

	li $v0, 4
	la $a0, result
	syscall
		
	li $v0, 10 # terminate the program gracefully
	syscall

